The end board: <a data-name="Red-eyes Dark Dragoon">Red-eyes Dark Dragoon</a> - <a data-name="Masquerena">Masquerena</a> - <a data-name="Megalith Phul">Megalith Phul</a> - <a data-name="Verte Anaconda">Verte Anaconda</a> + D <a data-name=".D. Crow">.D. Crow</a> and <a data-name="Nibiru">Nibiru</a> in hand

&nbsp;

First of all, we have the Nibiru searcher: <a data-name="Gallant Granite">Gallant Granite</a><a data-name="Gallant Granite"> you will xyz summon him with any 2 level 4 monsters.</a>

And the D .D. Crow Searcher: <a data-name="Lyrilusc - Recital Starling">Lyrilusc - Recital Starling</a> xyz summoned using any 2 Drytron.

